import React, { Component } from 'react';
import '../signInUp.css';

class SignUp extends Component {
    state = {
        buttonClick: 0
    };
    render() {
        return ( 
            <div className="signInUp">
                <h1>Create Account</h1>
                <form>
                    <input type="text" name="firstName" placeholder="First Nmae"/>
                    <input type="text" name="lastName" placeholder="last Nmae"/>
                    <input type="email" name="email" placeholder="Email"/>
                    <input type="text" name="username" placeholder="Username"/>
                    <input type="password" name="password" placeholder="Password"/>
                    <p><a href = "./signin" style = {this.extandNavBar}>Log in</a></p>
                    <button>Sign up</button>
                </form>
            </div>
        );
    }
}
    increment = () => {
        this.state.buttonClick++;
        const counter = this.state.buttonClick;
        this.setState({counter});
        // return counter;
    }
    extandNavBar = () => {
        let col;
        col = (this.state.buttonClick % 2 == 0) ? "col-lg-2 col-md-2 d-none d-sm-none  d-md-block listLength" : "col-12 col-md-2 col-lg-2 listLength";
        return col;
    }

export default SignUp;
